import React from "react";

function Footer() {
  return ( 

    <footer>
    <nav class="navbar fixed-bottom navbar-dark" >
      <a class="navbar-brand" href="#" id="footer"> &copy; 2021</a>
       <button class="btn btn-outline-primary" onClick="swapStyleSheet('./assets/css/night.css')">
      <i class="fas fa-cloud-moon fa-1.5x" className="moonsun">
      </i></button>
      <button class="btn btn-outline-primary" onClick="swapStyleSheet('./assets/css/bright.css')">
        <i class="fas fa-cloud-sun fa-1.5x" className="moonsun">
        </i></button>
    </nav>
  </footer>
  );
}

export default Footer;
